功能键分别为视频通话、MP3、和菜单键，所有按键的手感都比较一般，键程适中，当由于按键排列过于紧密，快速发短信时很容易误按，用户在使用时一定要多加注意。LG KD876手机机身周边的接口设计非常简洁，手机的厚度主要来自屏幕旋转轴的长度，如果舍弃旋屏设计的话，估计<span style=\"font-size:x-large;\"><strong><span style=\"color:#FF0000;\">厚度可以做到10mm以下</span></strong></span>。\r\n</p>', 'images/201508/thumb_img/1_thumb_G_1440964018312.jpg', 'images/201508/goods_img/1_G_1440964018153.jpg', 'images/201508/source_img/1_G_1440964018263.jpg', '1', '', '1', '1', '0', '0', '1240902890', '1', '1', '0', '0', '0', '0', '0', '7', '1441046267', '0', '', '-1', '-1', '1', '1', '2', '0.01', 'images/201507/1438293001097681166.jpg', '0', '', '0', '0', '1', '', '', '0', '0', '311', '0', '2596', '0', '0', '0.00', '0', '0.00', '1', '0', '', '', '', '', '', '', '', '', '', '', '', '0', '0', '', '0', '', '', '', '0');
